

CREATE TABLE majors (
    major_id VARCHAR(20) PRIMARY KEY,
    major_name VARCHAR(40) CHARACTER SET utf8mb4,
    address VARCHAR(100) CHARACTER SET utf8mb4,
    telephone VARCHAR(20),
    head_of_major VARCHAR(60) CHARACTER SET utf8mb4
);






CREATE TABLE classes (
    class_id VARCHAR(20) PRIMARY KEY,
    major_id VARCHAR(20),
    total_students INT CHECK (total_students > 0),
    homeroom_teacher VARCHAR(60) CHARACTER SET utf8mb4,
    FOREIGN KEY (major_id) REFERENCES majors(major_id)
);







CREATE TABLE students (
    student_id VARCHAR(20) PRIMARY KEY,
    class_id VARCHAR(20),
    student_name VARCHAR(60) CHARACTER SET utf8mb4 NOT NULL,
    date_of_birth DATE,
    gender BIT, -- 1 for male, 0 for female
    address VARCHAR(100) CHARACTER SET utf8mb4,
    telephone VARCHAR(20),
    FOREIGN KEY (class_id) REFERENCES classes(class_id)
);







CREATE TABLE subjects (
    subject_id VARCHAR(40) PRIMARY KEY,
    major_id VARCHAR(20),
    subject_name VARCHAR(100) CHARACTER SET utf8mb4,
    number_of_credits INT CHECK (number_of_credits > 0),
    FOREIGN KEY (major_id) REFERENCES majors(major_id)
);










CREATE TABLE scores (
    student_id VARCHAR(20),
    subject_id VARCHAR(40),
    score FLOAT CHECK (score >= 0),
    PRIMARY KEY (student_id, subject_id),
    FOREIGN KEY (student_id) REFERENCES students(student_id),
    FOREIGN KEY (subject_id) REFERENCES subjects(subject_id)
);







